import { AfterViewInit, Component, Input } from '@angular/core';
import { Subscription } from 'rxjs';

@Component({
  selector: 'rds-toast',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements AfterViewInit {
  title = 'rds-toasts';

    // messages: any[] = [];
  subscription!: Subscription;
  
   @Input()
   message='Hello, world! This is a toast message.';
  
   @Input()
   withImage = false
  
   @Input()
   withHeader =false
  
   @Input()
   background = ''
  
   @Input()
   customColor = false
  
   @Input()
   custcolor = '#000000'
  
   @Input()
   headerTitle = '#000000'
  
   @Input()
   time = '11 seconds  ago'
  
   @Input()
   textColor = ''
  
    @Input()
  position: 'Top-Left' | 'Top-Center' | 'Top-Right' | 'Middle-Left' | 'Middle-Center' | 'Middle-Right' | 'Bottom-Left' | 'Bottom-Center' | 'Bottom-Right' = 'Bottom-Right';

  clicked=false;
  
   //messages: ToastItems[] = [];
    constructor(
        //private messageService: MessageService
    ) { }
    ngOnInit(): void {     
   
    }
    ngAfterViewInit(): void {
            
    }
    
    public get show():any[]{  
      var customClasses =['']
      if(this.withHeader === true){
        customClasses.push('d-none')
      }  
      return customClasses
    }

    public get classes():any[]{  
      var customClasses =[`${this.background}`]
      if(this.customColor === true){
        customClasses.pop()
      }  
      return customClasses
    }

    public get img():any[]{  
      var customClasses =['']
      if(this.withImage === true){
        customClasses.push('d-none')
      }  
      return customClasses
    }

    showToast(){
      debugger;
      this.clicked=!this.clicked;
    }
    hideToast(){
      debugger;
      this.clicked=false;
    }
}

import { Component, Input, OnInit } from '@angular/core';
import { ControlValueAccessor } from '@angular/forms';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit ,ControlValueAccessor {
  title = 'rds-textarea';
  value='Text area value';
  onChange!:(value:string) => void
  onTouched!:() => void

  @Input()
  disabled?:boolean

  @Input()
  rows?:string;

  @Input()
  readonly?:boolean;

  @Input()
  label='text area'

 // @Input()
  //floatinglabel=false

  @Input()
  floatinginputLabel?: string

  @Input()
  placeholderText = 'TextArea'
  
  floatingcontent =false;

  constructor() { }
  writeValue(obj: any): void {
    this.value = obj;
  }
  registerOnChange(fn: any): void {
    this.onChange = fn;
  }
  registerOnTouched(fn: any): void {
    this.onTouched = fn;
  }

  ngOnInit(): void {
  }

  setValue(event:any){
    this.value = event.target.value
    this.onChange(this.value)
    this.onTouched()
  }

  public get divclasses():string[]{
    var classList =['mb-3']
   if(this.floatinginputLabel){
    classList.push('form-floating')
    this.floatingcontent=true;
   }else{
    this.floatingcontent=false;
   }
    
     return classList
  }
}

